					_codePerformance = value.StringVal;
					return;
				case 39: 
					_sustainabilityPerformance = value.StringVal;
					return;
				default:
					throw new XbimParserException(string.Format("Attribute index {0} is out of range for {1}", propIndex + 1, GetType().Name.ToUpper()));
			}
		}
